import React from "react";
import Classes from "./Classes";
import Styles from "./Styles";
import {Link} from "react-router-dom";

const Index = () => {
  return (
      <>
        <h1>Labs!</h1>
        <Link to="/hello">Hello</Link>|
        <Link to="/tuiter">Tuiter</Link>
        <Styles/>
        <Classes/>
      </>
  )
};

export default Index;
